import React from 'react';

function Row({ title, items, onMoreInfo }) {
  return (
    <div className="row">
      <h2 className="row-title">{title}</h2>
      <div className="row-items">
        {items.map(item => (
          <div key={item.id} className="row-item" onClick={() => onMoreInfo(item)}>
            <img src={item.thumbnail} alt={item.title} />
            <span>{item.title}</span>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Row;
